import React, { useEffect } from 'react'
import { useSelector } from 'react-redux'
import { SummaryRequest } from '../../API/APIRequest'
import SingleCard from '../Card/SingleCard'
import DeleteModel from '../helper/Delete/DeleteModel'
import TaskCard from '../TaskCard/TaskCard'

const Dashboard = () => {
  useEffect(()=>{
    SummaryRequest()
  },[]);
  let summaryData=useSelector((state)=>state.summary.value)
    const carObject={
        title:'Total Cars',
        totalNumber:750,
        icon:'ri-police-car-line'
      }
  return (
    <div className='dashboard'>
      <div className="dashboard__wrapper">
        <div className="dashboard__cards">
          {
            summaryData.map((item,i)=>(<SingleCard item={item}/>))
          }
       <SingleCard item={carObject}/>
       <SingleCard item={carObject}/>
       <SingleCard item={carObject}/>
       <SingleCard item={carObject}/>
          
        </div>


<div className="todo__task-wrapper">
<TaskCard/>
<TaskCard/>
<TaskCard/>
<TaskCard/>
<TaskCard/>
</div>
      </div>
      
    </div>
  )
}

export default Dashboard
